import React, { useEffect, useRef, useState } from 'react';
import { FaHeart, FaAngleDoubleRight, FaChevronRight, FaHandsHelping, FaPhoneAlt, FaCheck, FaBookOpen, FaHeartbeat, FaTint, FaHome, FaBed, FaUtensils, FaUserNurse, FaShieldAlt, FaWheelchair, FaPlay, FaQuoteLeft, FaArrowRight, FaQuestionCircle, FaCalendarAlt, FaBullhorn, FaHandHoldingHeart, FaChevronDown, FaRupeeSign, FaUsers, FaHandshake, FaLeaf } from 'react-icons/fa';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Autoplay, Pagination, Navigation } from 'swiper/modules';
import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';
import Navbar from './Navbar';
import Footer from './Footer';
import './HomePage.css';

function useInViewOnce(options = {}) {
  const { threshold = 0.1, root = null, rootMargin = '0px 0px -15% 0px' } = options;
  const ref = useRef(null);
  const [inView, setInView] = useState(false);
  useEffect(() => {
    const node = ref.current;
    if (!node || inView) return;
    const io = new IntersectionObserver(([entry]) => {
      if (entry.isIntersecting) {
        setInView(true);
        io.unobserve(entry.target);
      }
    }, { threshold, root, rootMargin });
    io.observe(node);
    return () => io.disconnect();
  }, [inView, threshold, root, rootMargin]);
  return [ref, inView];
}

function HomePage() {
  const [s7Ref, s7Visible] = useInViewOnce();
  const [s8Ref, s8Visible] = useInViewOnce();
  const [s9Ref, s9Visible] = useInViewOnce();

  const [activeTestimonial, setActiveTestimonial] = useState(0);
  const [openFaq, setOpenFaq] = useState(null);

  const milestones = [
    { icon: <FaCalendarAlt />, title: 'New Shelter Wing Opened', desc: '40 additional beds with accessible washrooms and warm lighting for comfort.', date: 'Aug 2025' },
    { icon: <FaBullhorn />, title: 'Winter Drive Announced', desc: 'Collecting blankets and thermals for elders in roadside communities.', date: 'Dec 2025' },
    { icon: <FaHandHoldingHeart />, title: 'Health Camp Series', desc: 'Monthly checkups with geriatric specialists and free medicine kits.', date: 'Jan–Mar 2026' }
  ];

  const testimonials = [
    { quote: 'I found peace and friends here. The evenings are full of stories and smiles.', name: 'Radha, 73', image: '/Images/story1.jpg' },
    { quote: 'They treat me with dignity. A warm bed and a warm heart make all the difference.', name: 'Imran, 79', image: '/Images/story2.jpg' },
    { quote: 'My medications are on time, and I never feel alone anymore.', name: 'Grace, 81', image: '/Images/story3.jpg' }
  ];

  const faqs = [
    { q: 'How can I sponsor a meal for seniors?', a: 'You can sponsor daily, weekly, or monthly meals. Visit the donation page, choose Meal Sponsorship, and select your frequency.' },
    { q: 'Do you provide medical support?', a: 'Yes. We run regular health camps, medicine support, and emergency care with partner hospitals.' },
    { q: 'Can I volunteer on weekends?', a: 'Absolutely. We welcome weekend volunteers for companionship, reading sessions, and activity support.' }
  ];

  useEffect(() => {
    if (!s7Visible) return;
    const id = setInterval(() => {
      setActiveTestimonial((prev) => (prev + 1) % testimonials.length);
    }, 4000);
    return () => clearInterval(id);
  }, [s7Visible, testimonials.length]);

  const [active, setActive] = useState(0);
  const [amount, setAmount] = useState(1500);

  const tabs = [
    { key: 'shelter', title: 'Shelter & Comfort', image: '/Images/old1.jpg', bullets: ['Clean, safe rooms', 'Warm bedding & clothing', 'Companionship circles'] },
    { key: 'health', title: 'Healthcare & Support', image: '/Images/old2.jpg', bullets: ['Regular checkups', 'Medicine support', 'Emergency care access'] },
    { key: 'meals', title: 'Meals & Nutrition', image: '/Images/old3.jpg', bullets: ['Nutritious meals daily', 'Special diets for elders', 'Hydration & fruits'] }
  ];

  const quick = [500, 1500, 3500, 10000];

  useEffect(() => {
    if (!s8Visible) return;
    const id = setInterval(() => {
      setActive((prev) => (prev + 1) % tabs.length);
    }, 5000);
    return () => clearInterval(id);
  }, [s8Visible, tabs.length]);

  const items = [
    { img: '/Images/01-child.svg', title: 'help for families', desc: 'We provide maximum support to families with 3+ children, including psychological and financial help.' },
    { img: '/Images/02-clothes.svg', title: 'clothing', desc: 'Kids from regions with severe weather conditions are our top priority. We provide clothes for kids of any age.' },
    { img: '/Images/03-ribbon.svg', title: 'Educational programs', desc: 'We provide funding for educational institutions for children, including the creation of an inclusive environment.' },
    { img: '/Images/04-food donation.svg', title: 'Food for children', desc: 'Our organization provides food for needy children and their families in Africa, China, and Eastern Europe.' },
    { img: '/Images/05-placeholder.svg', title: 'Psychological support', desc: 'Our non-profit organization offers psychological help to children who have suffered from domestic violence.' },
    { img: '/Images/06-hospital.svg', title: 'Health care', desc: 'We provide funding for health care facilities for children. We also buy medicines for the treatment of children.' }
  ];

  return null;
}
